import React from 'react';
import footer from './footer.css'

function Footer() {
    return (
        <footer>
        <div className ={`contact ${footer.contact}`}>
            <a href="tel:+13134006501"><i class="fa-solid fa-phone"></i></a>
            <a href="https://www.linkedin.com/in/vlada-bolotova-34b911257/"><i class="fab fa-linkedin-in"></i></a>
            <a href="https://github.com/VladaBolotova"><i class="fa-brands fa-github"></i></a>
            <a href="https://www.instagram.com/ladaaa.b/?hl=en"><i class="fa-brands fa-instagram"></i></a>
            <a href="mailto:vladislavabolotova@gmail.com"><i class="fa-solid fa-square-envelope"></i></a>
        </div>

    </footer>
    )
}

export default Footer;


